import React from 'react'

const Greenbtn = ({title, onClick, className}) => {
  return (
   <button className='border bg-lightcolor text-darkcolor border-lightcolor hover:bg-transperent hover:text-lightcolor
   rounded-md'>
    {title}
   </button>
  )
}

export default Greenbtn
